import React from "react";
import mobilehero from "../assets/mobile-hero.png";

import img from "../assets/yellow purple boxes.png";
import "../App.css";
import Navbar from "../compoments/navbar/Navbar";
import Download from "../compoments/Download";
import Footer from "../compoments/footer/Footer";
import About from "../compoments/About";
import { Fade } from "react-reveal";

const Home = () => {
  return (
    <>
      <div>
      <Navbar />
      </div>
      <div className="container-fluid ">

        <Fade top bottom>
          <div style={{ marginTop: "-3%" }} className="desktop-heroimg">
            <div className="container-fluid" style={{ padding: "0", position: "relative" }}>
              <div className="" style={{ position: "relative" }}>
                <img className="hero-img" src={img} alt="" />
                <h1
            style={{
              position: "absolute",
              top: "50%",
              left: "48%",
              transform: "translate(-50%, -50%)",
              color: "#ffffff",
              fontFamily: "'Merriweather', serif",
              fontWeight: "600",
              fontSize: "9rem",
              textAlign: "center",
              letterSpacing: "1px",
            }}
          >

          </h1>   

              </div>
            </div>
          </div>
        </Fade>

        <Fade top bottom>
          <div className="mobile-heroimg">
            <div className="container-fluid">
              <div className="">
                <img className="hero-img" src={mobilehero} alt="" />
              </div>
            </div>
          </div>
        </Fade>
      </div>
      <div>
        <About />
      </div>

      <div>
        <Download />
      </div>

      <div>
        <Footer />
      </div>
    </>
  );
};

export default Home;
